import React from 'react';
import '../styles/Home.css';
import ParticleAnimation from './ParticleAnimation';
import CardList from './CardList';

const Home = () => {
  return (
      <div className='home'>
        <h1>Welcome to the Hip Shop</h1>
        <p>
          Browse our collection of high-quality products! Feel free to explore the site and let us know if you have any questions.
        </p>
        <ParticleAnimation />
        <CardList />
      </div>
  );
};

export default Home;
